// src/pages/BuildRoutes.js
import React, { useState, useEffect } from 'react';
import { DragDropContext, Droppable, Draggable } from 'react-beautiful-dnd';
import axios from 'axios';
import CustomerMap from '../components/CustomerMap';

const BuildRoutes = () => {
  const [customers, setCustomers] = useState([]);
  const [routes, setRoutes] = useState([]);
  const [loading, setLoading] = useState(true);
  const [error, setError] = useState(null);

  useEffect(() => {
    fetchData();
  }, []);

  const fetchData = async () => {
    setLoading(true);
    setError(null);
    try {
      const [customersResponse, routesResponse] = await Promise.all([
        axios.get('http://localhost:5000/api/customers', {
          headers: { Authorization: `Bearer ${localStorage.getItem('token')}` }
        }),
        axios.get('http://localhost:5000/api/routes', {
          headers: { Authorization: `Bearer ${localStorage.getItem('token')}` }
        })
      ]);
      setCustomers(customersResponse.data);
      setRoutes(routesResponse.data);
    } catch (err) {
      console.error('Error fetching data:', err);
      setError('Failed to load data. Please try refreshing the page.');
    } finally {
      setLoading(false);
    }
  };

  const onDragEnd = (result) => {
    const { source, destination } = result;

    if (!destination) return;

    const newRoutes = [...routes];
    const newCustomers = [...customers];

    if (source.droppableId === 'customersList' && destination.droppableId.startsWith('route-')) {
      const routeIndex = newRoutes.findIndex(route => route._id === destination.droppableId);
      const [movedCustomer] = newCustomers.splice(source.index, 1);
      newRoutes[routeIndex].customers.splice(destination.index, 0, movedCustomer);
    } else if (source.droppableId.startsWith('route-') && destination.droppableId === 'customersList') {
      const routeIndex = newRoutes.findIndex(route => route._id === source.droppableId);
      const [movedCustomer] = newRoutes[routeIndex].customers.splice(source.index, 1);
      newCustomers.splice(destination.index, 0, movedCustomer);
    } else if (source.droppableId.startsWith('route-') && destination.droppableId.startsWith('route-')) {
      const sourceRouteIndex = newRoutes.findIndex(route => route._id === source.droppableId);
      const destRouteIndex = newRoutes.findIndex(route => route._id === destination.droppableId);
      const [movedCustomer] = newRoutes[sourceRouteIndex].customers.splice(source.index, 1);
      newRoutes[destRouteIndex].customers.splice(destination.index, 0, movedCustomer);
    }

    setRoutes(newRoutes);
    setCustomers(newCustomers);
  };

  const addNewRoute = () => {
    setRoutes(prevRoutes => [...prevRoutes, { _id: `route-${Date.now()}`, name: `Route ${prevRoutes.length + 1}`, customers: [] }]);
  };

  if (loading) return <div className="text-center mt-8">Loading...</div>;
  if (error) return <div className="text-center mt-8 text-red-600">{error}</div>;

  return (
    <div className="build-routes p-6">
      <h1 className="text-2xl font-bold mb-4">Build Routes</h1>
      <button onClick={addNewRoute} className="bg-blue-500 text-white px-4 py-2 rounded mb-4">
        Add New Route
      </button>
      <DragDropContext onDragEnd={onDragEnd}>
        <div className="flex space-x-4">
          <div className="routes-list w-1/3">
            <h2 className="text-xl font-semibold mb-2">Routes</h2>
            {routes.map((route) => (
              <Droppable key={route._id} droppableId={route._id}>
                {(provided) => (
                  <div {...provided.droppableProps} ref={provided.innerRef} className="bg-gray-100 p-2 rounded mb-4 min-h-[100px]">
                    <h3 className="font-semibold">{route.name}</h3>
                    {route.customers.map((customer, index) => (
                      <Draggable key={customer._id} draggableId={customer._id.toString()} index={index}>
                        {(provided) => (
                          <div
                            ref={provided.innerRef}
                            {...provided.draggableProps}
                            {...provided.dragHandleProps}
                            className="bg-white p-2 mb-2 rounded shadow"
                          >
                            {customer.name} - {customer.address?.street}
                          </div>
                        )}
                      </Draggable>
                    ))}
                    {provided.placeholder}
                  </div>
                )}
              </Droppable>
            ))}
          </div>
          <div className="customers-list w-2/3">
            <h2 className="text-xl font-semibold mb-2">Customers</h2>
            <Droppable droppableId="customersList">
              {(provided) => (
                <div {...provided.droppableProps} ref={provided.innerRef} className="bg-gray-100 p-2 rounded min-h-[400px] overflow-y-auto">
                  {customers.map((customer, index) => (
                    <Draggable key={customer._id} draggableId={customer._id.toString()} index={index}>
                      {(provided) => (
                        <div
                          ref={provided.innerRef}
                          {...provided.draggableProps}
                          {...provided.dragHandleProps}
                          className="bg-white p-2 mb-2 rounded shadow"
                        >
                          {customer.name} - {customer.address?.street}
                        </div>
                      )}
                    </Draggable>
                  ))}
                  {provided.placeholder}
                </div>
              )}
            </Droppable>
          </div>
        </div>
      </DragDropContext>
      <div className="map-container mt-6">
        <h2 className="text-xl font-semibold mb-2">Customer Map</h2>
        <CustomerMap customers={customers} />
      </div>
    </div>
  );
};

export default BuildRoutes;
